         "App Specific Statement" : "[engbApp Specific Statement]",
         "The App allows the user to take images of machines or other assets as part of using the Maximo Application Suite of software. While this App is designed for images solely of assets, background may be inadvertently included. Accordingly, you must ensure you have all necessary permissions to take and use the images, including but not restricted to, permission to take images in the area in which you are working. You are solely responsible for the images, voice recordings, annotations and the like which are taken by the App and used by the Authorized Programs." : "[engbThe App allows the user to take images of machines or other assets as part of using the Maximo Application Suite of software. While this App is designed for images solely of assets, background may be inadvertently included. Accordingly, you must ensure you have all necessary permissions to take and use the images, including but not restricted to, permission to take images in the area in which you are working. You are solely responsible for the images, voice recordings, annotations and the like which are taken by the App and used by the Authorized Programs.]",
         "In addition, as part of the operation of the App, certain data may be transmitted and stored, including, but not limited to, user ID, phone numbers, email addresses, digital signatures, geolocations, camera (for images and video), audio and similar personal information. You may also choose to include other data of a personal or sensitive nature. To the extent you control any such data, you are responsible for obtaining all necessary permissions and adhering to all applicable data privacy regulations" : "[engbIn addition, as part of the operation of the App, certain data may be transmitted and stored, including, but not limited to, user ID, phone numbers, email addresses, digital signatures, geolocations, camera (for images and video), audio and similar personal information. You may also choose to include other data of a personal or sensitive nature. To the extent you control any such data, you are responsible for obtaining all necessary permissions and adhering to all applicable data privacy regulations]",
         "IBM may push certain notifications to your copy of the App. You agree to receive such notifications. We may provide additional data privacy information by using a supplementary privacy notice." : "[engbIBM may push certain notifications to your copy of the App. You agree to receive such notifications. We may provide additional data privacy information by using a supplementary privacy notice.]",
         "In General" : "[engbIn General]",
         "Personal Information We Collect and Use" : "[engbPersonal Information We Collect and Use]",
         "This section describes the various types of information that we collect and how we use it." : "[engbThis section describes the various types of information that we collect and how we use it.]",
         "Your Account \u2013 If your mobile app requires an IBMid" : "[engbYour Account – If your mobile app requires an IBMid]",
         "You can create an account with IBM by creating an IBMid. An IBMid provides IBM with your name, email address, and country or region of residence. We may require an IBMid for certain services, such as the use of IBM Cloud and Online Services (see below)." : "[engbYou can create an account with IBM by creating an IBMid. An IBMid provides IBM with your name, email address, and country or region of residence. We may require an IBMid for certain services, such as the use of IBM Cloud and Online Services (see below).]",
         "We may also store your details from business contact information that you provide to us, or that we collect from your organization, our Business Partners, or our suppliers." : "[engbWe may also store your details from business contact information that you provide to us, or that we collect from your organization, our Business Partners, or our suppliers.]",
         "An IBMid uniquely identifies you when you access our websites, make a request or order, or use a product or service. If you log in to our websites with an IBMid we may link the information we collect with your account. An IBMid is also used to give you access to IBM Cloud and Online Services (see below) and allows you to manage your contract and billing history. The email address in your IBMid may be used to contact you in relation to any services to which you subscribe." : "[engbAn IBMid uniquely identifies you when you access our websites, make a request or order, or use a product or service. If you log in to our websites with an IBMid we may link the information we collect with your account. An IBMid is also used to give you access to IBM Cloud and Online Services (see below) and allows you to manage your contract and billing history. The email address in your IBMid may be used to contact you in relation to any services to which you subscribe.]",
         "An IBMid uniquely identifies you when you access our websites, make a request or order, or use a product or service. If you log in to our websites with an IBMid we may link the information we collect with your account. An IBMid is also used to give you access to IBM Cloud and Online Services and allows you to manage your contract and billing history. The email address in your IBMid may be used to contact you in relation to any services to which you subscribe." : "[engbAn IBMid uniquely identifies you when you access our websites, make a request or order, or use a product or service. If you log in to our websites with an IBMid we may link the information we collect with your account. An IBMid is also used to give you access to IBM Cloud and Online Services and allows you to manage your contract and billing history. The email address in your IBMid may be used to contact you in relation to any services to which you subscribe.]",
         "Business contact information is typically information that you would find on a business card, such as name and business contact details. We use this information to contact or communicate with you about business matters. If we receive business contact information from a third party, such as an IBM Business Partner or supplier, we will confirm that the information was shared appropriately." : "[engbBusiness contact information is typically information that you would find on a business card, such as name and business contact details. We use this information to contact or communicate with you about business matters. If we receive business contact information from a third party, such as an IBM Business Partner or supplier, we will confirm that the information was shared appropriately.]",
         "We may also combine your business contact information with other business-relevant information, such as information about your professional education, skills, work experience, or other publicly available information, such as business-related blogs, publications, job roles, and certifications. This information may be used to tailor our interactions with you in any part of IBM\u2019s business, for example in the sales process, to maintain a relationship with you, and for post-contractual relationships." : "[engbWe may also combine your business contact information with other business-relevant information, such as information about your professional education, skills, work experience, or other publicly available information, such as business-related blogs, publications, job roles, and certifications. This information may be used to tailor our interactions with you in any part of IBM’s business, for example in the sales process, to maintain a relationship with you, and for post-contractual relationships.]",
